import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Main from './components/Main';
import Tlogin from './components/Logindiv';
import Slogin from './components/Logindiv';
//import LoginDiv from './components/Logindiv';
import * as serviceWorker from './serviceWorker';

class TSLR extends React.Component {
    constructor() {
        super();
        this.handleInputFunction = this.handleInputFunction.bind(this);
      }
      state = {
        name: '',
        activeMenu: "Main",
      };
      handleInputFunction(e) {
        e.preventDefault();
        this.setState({ activeMenu: e.target.value });
      }
        
    renderSection = () => {
        switch (this.state.activeMenu) {
            case "Main":
                return <Main ourInputFunction={this.handleInputFunction} />
            case "Slogin":
                return <Slogin/>
            case "Tlogin":
                return <Tlogin/>
            case "SRegister":
                return <Slogin/>
            case "TRegister":
                return <Tlogin/>
            default:
                return <div></div>;
        }
    }
    changeSection = (newSection) => {
        this.setState({ activeMenu: newSection });
    }

    render() {
        return (
            <main >
                <section>
                    {this.renderSection()}
                </section>
            </main>

        );
    }


